import React from "react";
import { Link, Router } from "react-router-dom";

function Home(props) {
  let mathRandom = Math.random();
  let randomScreen = Math.floor(mathRandom * 10);
  console.log(randomScreen);
  return (
    <>
      <div className="App">
        <header className="App-header">
          <h1>Welcome!</h1>
          <h2>
            This is the home screen, To get started please visit one the screens
            paths
          </h2>
          <Link to="screen=1">Click here for screen #1</Link>
        </header>
      </div>
    </>
  );
}

export default Home;
